import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './asset/AccessFolder/Login';
import ChatParent from './asset/ChatParentFolder/ChatParent';

function App(){

  return(
        <Router>
               <div>
                    <Switch>
                      <Route exact path="/login">
                       <Login />
                      </Route>
                      <Route exact path="/">
                        <ChatParent />
                      </Route>
                      </Switch>
                </div>
      </Router>
  );

}

export default App;
